"<div>\n<i class=\"NoteType\">\nLink\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<a href=\"https://digi.kansalliskirjasto.fi/sanomalehti/binding/703702/articles/2926608\">https://digi.kansalliskirjasto.fi/sanomalehti/binding/703702/articles/2926608</a>\n</p>\n</div>\n<i class=\"NoteType\">\nLink\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<a href=\"https://digi.kansalliskirjasto.fi/sanomalehti/binding/703702?page=46\">https://digi.kansalliskirjasto.fi/sanomalehti/binding/703702?page=46</a>\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nLink\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<a href=\"http://digi.kansalliskirjasto.fi/sanomalehti/binding/703702?page=1#?page=51\">http://digi.kansalliskirjasto.fi/sanomalehti/binding/703702?page=1#?page=51</a>\n</p>\n</div>\n<i class=\"NoteType\">\nTranscript\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<strong>Lis\u00e4lehti Suomalaisen Virallisen Lehden N:oon 109.</strong><br />\n<strong>\t</strong><span style=\"font-size:8px;\"><strong>Lauantaina 12 p:n\u00e4 Toukokuuta 1906.</strong></span><strong></strong><br />\n<strong>Bihang till Finalnds Allm\u00e4nna Tidning N:o 109.</strong><br />\n<strong>\t</strong><span style=\"font-size:8px;\"><strong>L\u00f6rdagen den 12 Maj 1906.</strong></span><strong></strong>\n</p>\n<p>\n<strong>Nimenmuuttoja.</strong><br />\n<strong></strong><span style=\"font-size:9px;\"><strong>\tMe alempana nykyisten kotipaikkaimme mu-</strong></span><br />\n<span style=\"font-size:9px;\"><strong>kaan kaupungittain ja pit\u00e4jitt\u00e4in luetellut suoma-</strong></span><br />\n<span style=\"font-size:9px;\"><strong>laiset saatamme t\u00e4ten yhteisesti tiedoksi, ett\u00e4 t\u00e4st\u00e4</strong></span><br />\n<span style=\"font-size:9px;\"><strong>toukokuun 12:nnesta p\u00e4iv\u00e4st\u00e4, suomalaisuuden he-</strong></span><br />\n<span style=\"font-size:9px;\"><strong>r\u00e4tt\u00e4j\u00e4n J. V. Snellmanin muistop\u00e4iv\u00e4st\u00e4 alkaen</strong></span><br />\n<span style=\"font-size:9px;\"><strong>tulemme k\u00e4ytt\u00e4m\u00e4\u00e4n kukin sit\u00e4 suomenkielist\u00e4</strong></span><br />\n<span style=\"font-size:9px;\"><strong>sukunime\u00e4, joka alempana mainitaan t\u00e4h\u00e4nastisen</strong></span><br />\n<span style=\"font-size:9px;\"><strong>nimemme vierell\u00e4.</strong></span><br />\n<span style=\"font-size:9px;\"><strong>\tSamalla pyyd\u00e4mme niiden suorakuntain arv.</strong></span><br />\n<span style=\"font-size:9px;\"><strong>kirkkoherranvirastoja, joihin nyky\u00f6\u00f6n kuulumme,</strong></span><br />\n<span style=\"font-size:9px;\"><strong>hyv\u00e4ntahtoisesti ensi tilaisuudessa merkitsem\u00e4\u00e4n</strong></span><br />\n<span style=\"font-size:9px;\"><strong>nimenmuutoksemme kirkonkirjaan.</strong></span><strong></strong>\n</p>\n<p>\n<strong>Namnf\u00f6r\u00e4ndringar.</strong><br />\n<strong></strong><span style=\"font-size:9px;\"><strong>\tVi h\u00e4r nedan efter v\u00e5ra nuvarande hemorter</strong></span><br />\n<span style=\"font-size:9px;\"><strong>stads- och sockenvis uppr\u00e4knade finnar tillk\u00e4nna-</strong></span><br />\n<span style=\"font-size:9px;\"><strong>gifva h\u00e4rmedels gemensamt att vi fr\u00e5n och med</strong></span><br />\n<span style=\"font-size:9px;\"><strong>den 12 innevarande maj, minnesdagen af finsk-</strong></span><br />\n<span style=\"font-size:9px;\"><strong>hetens v\u00e4ckelseman J. V. Snellman, komma att</strong></span><br />\n<span style=\"font-size:9px;\"><strong>anv\u00e4nda hvar och en det finska sl\u00e4ktnamn, som</strong></span><br />\n<span style=\"font-size:9px;\"><strong>h\u00e4r nedan n\u00e4mnes vid sidan af v\u00e5rt tidigare</strong></span><br />\n<span style=\"font-size:9px;\"><strong> namn.</strong></span><br />\n<span style=\"font-size:9px;\"><strong>\tTillika anh\u00e5lla vi, att pastorsembetena i de</strong></span><br />\n<span style=\"font-size:9px;\"><strong>f\u00f6rsamlingar vi nu tillh\u00f6ra godhetsfullt snarast</strong></span><br />\n<span style=\"font-size:9px;\"><strong>m\u00f6jligt ville i kyrkob\u00f6ckerna inf\u00f6ra v\u00e5ra namn-</strong></span><br />\n<span style=\"font-size:9px;\"><strong>f\u00f6randringar.</strong></span><strong></strong>\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n<strong>\t\t\tTuusula \u2013 Tusby</strong>\n</p>\n<p>\n\tNordberg Teodor \u2013 Pohja Teodor\n</p>\n</div>\n</div>",
