"<div>\n<i class=\"NoteType\">\nLink\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<a href=\"http://digi.narc.fi/digi/view.ka?kuid=24833412\">http://digi.narc.fi/digi/view.ka?kuid=24833412</a><br />\n<a href=\"https://astia.narc.fi/uusiastia/viewer/?fileId=6038725281&amp;aineistoId=1167610777\">https://astia.narc.fi/uusiastia/viewer/?fileId=6038725281&amp;aineistoId=1167610777</a>\n</p>\n</div>\n<i class=\"NoteType\">\nLink\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<a href=\"https://www.sukuhistoria.fi/sshy/kirjat/Kirkonkirjat/porvoo/rippikirja_1786-1794_ruotksrk_es278/171.htm\">https://www.sukuhistoria.fi/sshy/kirjat/Kirkonkirjat/porvoo/rippikirja_1786-1794_ruotksrk_es278/171.htm</a>\n</p>\n</div>\n<i class=\"NoteType\">\nTranscript\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<span style=\"font-family:'Courier New';\">165 Hindh\u00e5r</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp;Smed Joh Matsson &nbsp; &nbsp; &nbsp; 1740</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp;hu Caisa Henrics &nbsp; &nbsp; &nbsp; 1750</span><br />\n<span style=\"font-family:'Courier New';\">1 &nbsp;s Staf Joh &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1770</span><br />\n<span style=\"font-family:'Courier New';\">+ &nbsp;pg Anna H Johansdr &nbsp; &nbsp; 1774</span><br />\n<span style=\"font-family:'Courier New';\">+ &nbsp;s Fredric Johansson &nbsp; &nbsp;1776</span><br />\n<span style=\"font-family:'Courier New';\">2 &nbsp;h Caisa Hansdr &nbsp; &nbsp; &nbsp; &nbsp; 1771</span>\n</p>\n</div>\n<i class=\"NoteType\">\nResearch\n</i>\n<div class=\"grampsstylednote\">\n<p>\nFredric Johansson asuu rippikirjan 1786-1794 mukaan <br />\nis\u00e4ns\u00e4 sepp\u00e4 Johan Mattssonin luona Hindh\u00e5r:ssa.<br />\nH\u00e4nen syntym\u00e4ajaksi on merkitty 1776.<br />\nEhtoollismerkint\u00f6j\u00e4 on v\u00e4lill\u00e4 10.4.1791-2.3.1793, <br />\nmink\u00e4 j\u00e4lkeen loppuvat. <br />\nMuulla perheell\u00e4 merkinn\u00e4t jatkuu 10.8.1794 asti.<br />\nSeuraavassa rippikirjassa Fredric ei ole merkittyn\u00e4 <br />\nmuun perheen yhteyteen.<br />\nT\u00e4st\u00e4 voi p\u00e4\u00e4tell\u00e4 ett\u00e4 Henric on joko kuollut tai <br />\nmuuttanut pois maaliskuun alun 1793 j\u00e4lkeen.\n</p>\n<p>\nSeurakunnasta pois muuttaneiden tietoja ei ole tuolta ajalta helposti saatavilla.\n</p>\n<p>\nKuolleista l\u00f6ytyy HisKin perusteella vuosilta 1793-1794 <br />\nnelj\u00e4 henkil\u00f6\u00e4 joilla etunimen\u00e4 Fredric (kaikki itse asiassa Carl Fredric) <br />\nn\u00e4ist\u00e4 nuorin 7vko ja vanhin 3v 9kk. (Oikea ik\u00e4 olisi n. 17-18)<br />\nKuolleista l\u00f6ytyy 62 kpl henkil\u00f6it\u00e4 joilla is\u00e4n nimen\u00e4 Johan, <br />\nn\u00e4ist\u00e4 kaikki joko v\u00e4\u00e4r\u00e4\u00e4 sukupuolta tai selke\u00e4sti v\u00e4\u00e4r\u00e4n ik\u00e4isi\u00e4.\n</p>\n<p>\nEdelleen rippikirjassa 1786-1794 on S\u00f6derveckkoskella <br />\nsepp\u00e4 Isaac Sandberg, jolla on oppipoika Fredric Johansson, <br />\njonka syntym\u00e4aika 1776. <br />\nT\u00e4lle on merkitty ehtoollisk\u00e4yntej\u00e4 alkaen 13.4.1794<br />\nT\u00e4m\u00e4 t\u00e4sm\u00e4isi siihen, ett\u00e4 sepp\u00e4 Johan Mattssonin poika <br />\nFredric on mennyt toisen sep\u00e4n oppipojaksi.\n</p>\n<p>\n1776 on seurakunnassa kirjattu syntyneeksi nelj\u00e4 Fredric Johanssonia:\n</p>\n<p>\n1776-03-11 Johan Erichsson/Cathrina Henricsdr Hindh\u00e5r Smeden https://www.sukuhistoria.fi/sshy/sivut/jasenille/paikat.php?bid=38709&amp;pnum=273<br />\n1776-06-07 Johan \u00c5berg/Anna Andersdr Haicko https://www.sukuhistoria.fi/sshy/sivut/jasenille/paikat.php?bid=38709&amp;pnum=276<br />\n1776-06-18 Johan Bergsten/Maria Johansdr Str\u00f6msberg https://www.sukuhistoria.fi/sshy/sivut/jasenille/paikat.php?bid=38709&amp;pnum=276<br />\n1776-06-21 Johan Ersson/Stina Matsdotter Stensb\u00f6le https://www.sukuhistoria.fi/sshy/sivut/jasenille/paikat.php?bid=38709&amp;pnum=277\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nCitation\n</i>\n<div class=\"grampsstylednote\">\n<p>\nHufvudstadsbladet, 22.06.1938, nro 165, s. 2<br />\nhttps://digi.kansalliskirjasto.fi/sanomalehti/binding/2210742?page=2<br />\nKansalliskirjaston digitaaliset aineistot\n</p>\n</div>\n<i class=\"NoteType\">\nLink\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<a href=\"https://digi.kansalliskirjasto.fi/sanomalehti/binding/2210742?term=Viktor%20Wilhelm%20Nystr%C3%B6ms&amp;page=2\">https://digi.kansalliskirjasto.fi/sanomalehti/binding/2210742?term=Viktor%20Wilhelm%20Nystr%C3%B6ms&amp;page=2</a>\n</p>\n</div>\n<i class=\"NoteType\">\nTranscript\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<span style=\"font-family:'Courier New';\">&nbsp; F\u00f6r all den vackra hyllning som</span><br />\n<span style=\"font-family:'Courier New';\">av sl\u00e4kt, arbetskamrater och v\u00e4n-</span><br />\n<span style=\"font-family:'Courier New';\">ner \u00e4gnats v\u00e5r k\u00e4re</span><br />\n<span style=\"font-family:'Courier New';\"></span><strong><span style=\"font-family:'Courier New';\">&nbsp; &nbsp; Viktor Wilhelm Nystr\u00f6ms</span></strong><span style=\"font-family:'Courier New';\"></span><br />\n<span style=\"font-family:'Courier New';\">minne, samt f\u00f6r allt varmt delta-</span><br />\n<span style=\"font-family:'Courier New';\">gande i v\u00e5r stora sorg framb\u00e4ra vi</span><br />\n<span style=\"font-family:'Courier New';\">h\u00e4rmed v\u00e5rt djupt k\u00e4nda tack.</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp; &nbsp; &nbsp;</span><strong><span style=\"font-family:'Courier New';\">Elin Nystr\u00f6m</span></strong><br />\n<strong><span style=\"font-family:'Courier New';\">&nbsp; &nbsp; &nbsp; &nbsp;Ragnar och Elsa Nystr\u00f6m</span></strong><strong></strong>\n</p>\n</div>\n</div>",
