"<div>\n<i class=\"NoteType\">\nLink\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<a href=\"http://www.sukuhistoria.fi/sshy/kirjat/Kirkonkirjat/helsinki/syntyneet_1856-1884_mko1-40/1734.htm\">http://www.sukuhistoria.fi/sshy/kirjat/Kirkonkirjat/helsinki/syntyneet_1856-1884_mko1-40/1734.htm</a>\n</p>\n</div>\n<i class=\"NoteType\">\nTranscript\n</i>\n<div class=\"grampsstylednote\">\n<p>\nFebruari 1882\n</p>\n<p>\nViktor Ferdinand\t19\t6/3\tFldr Arb Ferdinand Nordberg mhu Sofia Wilh Holmstr\u00f6m 35 X 3-731<br />\n\t\t\t\t\t\tFddr ju <a href=\"person.html?idx=382\">Anna Charl Fagerstr\u00f6m</a>, ju Anna Helena Fager<br />\n\t\t\t\t\t\tstr\u00f6m, Arb. <a href=\"person.html?idx=384\">Johan Ferdinand Fagerstr\u00f6m</a>\n</p>\n</div>\n<i class=\"NoteType\">\nResearch\n</i>\n<div class=\"grampsstylednote\">\n<p>\nKummeiksi on kirjattu \"Ju Anna Charl. Fagerstr\u00f6m, Ju Anna Helena Fagerstr\u00f6m, Arb. Johan Ferdinand Fagerstr\u00f6m\"<br />\nN\u00e4ist\u00e4 <a href=\"person.html?idx=382\">Anna Charlotta (s.1859)</a> ja <a href=\"person.html?idx=384\">Johan Ferdinand (s.1855)</a> ovat sisarukset, mutta Anna Helena Fagerstr\u00f6m ei n\u00e4yt\u00e4 sopivan.<br />\n<a href=\"family.html?fdx=106\">Perheest\u00e4</a> l\u00f6ytyy \u00e4iti <a href=\"person.html?idx=1118\">Anna Helena Tunberg (s.1826)</a> sek\u00e4 tyt\u00e4r <a href=\"person.html?idx=386\">Maria Sofia (s.1861)</a>  <br />\nKoska kaste on vuodelta 1886 ja \"Anna Helena Fagerstr\u00f6m\" on merkitty olevan Ju[ngfru?] pid\u00e4n todenn\u00e4k\u00f6isen\u00e4 <br />\nett\u00e4 \"Anna Helena Fagerstr\u00f6m\" on virhe (sotkettu \u00e4idin ja tytt\u00e4ren nimet) jonka tilalla kuuluisi olla kahden muun kummin sisko Maria Sofia Fagerstr\u00f6m.<br />\n(On my\u00f6s mahdollista ett\u00e4 kyseess\u00e4 on esim. serkku, t\u00e4t\u00e4 en ole selvitt\u00e4nyt viel\u00e4 lainkaan)\n</p>\n</div>\n</div>",
