"<div>\n<i class=\"NoteType\">\nCitation\n</i>\n<div class=\"grampsstylednote\">\n<p>\nViipurin kaupungin osoitekalenteri ja liikehakemisto, 01.01.1926, s. 390<br />\nhttps://digi.kansalliskirjasto.fi/aikakausi/binding/1262791?page=390<br />\nKansalliskirjaston digitaaliset aineistot\n</p>\n</div>\n<i class=\"NoteType\">\nLink\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<a href=\"https://digi.kansalliskirjasto.fi/aikakausi/binding/1262790?page=363\">https://digi.kansalliskirjasto.fi/aikakausi/binding/1262790?page=363</a>\n</p>\n</div>\n<i class=\"NoteType\">\nTranscript\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<strong></strong><span style=\"font-family:'Courier New';\"><strong>Nordberg, Alice,</strong></span><span style=\"font-family:'Courier New';\"> neiti, Viskaalink. 4.</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp;- </span><strong><span style=\"font-family:'Courier New';\">Elviira Maria,</span></strong><span style=\"font-family:'Courier New';\"> konttoristi, Viskaa-</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp;link. 4.</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp;- </span><strong><span style=\"font-family:'Courier New';\">Hilda Maria, </span></strong><span style=\"font-family:'Courier New';\">rouva, Viskaalink. 4.</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp;- P</span><strong><span style=\"font-family:'Courier New';\">aul Vilhelm, </span></strong><span style=\"font-family:'Courier New';\"> Viskaalink. 4.</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp;- </span><strong><span style=\"font-family:'Courier New';\">Tyyne Elisabeth, </span></strong><span style=\"font-family:'Courier New';\">yliopp., Viskaalin-</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp;katu 4.</span>\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nCitation\n</i>\n<div class=\"grampsstylednote\">\n<p>\nPostimies, 01.03.1928, nro 3, s. 11<br />\nhttps://digi.kansalliskirjasto.fi/aikakausi/binding/898568?page=11<br />\nKansalliskirjaston digitaaliset aineistot\n</p>\n</div>\n<i class=\"NoteType\">\nLink\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<a href=\"https://digi.kansalliskirjasto.fi/aikakausi/binding/898568?term=Nystr%C3%B6m&amp;page=11\">https://digi.kansalliskirjasto.fi/aikakausi/binding/898568?term=Nystr%C3%B6m&amp;page=11</a>\n</p>\n</div>\n<i class=\"NoteType\">\nTranscript\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span><strong><span style=\"font-family:'Courier New';\">Sport.</span></strong><span style=\"font-family:'Courier New';\"></span><br />\n<span style=\"font-family:'Courier New';\">&nbsp; S\u00f6ndagen den 19 febr. hade brevb\u00e4rarna vid S\u00f6r-</span><br />\n<span style=\"font-family:'Courier New';\">n\u00e4s brevb\u00e4rarekontor anordnat sedvanlig skidt\u00e4v-</span><br />\n<span style=\"font-family:'Courier New';\">lan sinsemellan \u00e5 5 km. bana.</span><br />\n<span style=\"font-family:'Courier New';\">T\u00e4vlades om de av O. Vaulo och A. Tiljander </span><br />\n<span style=\"font-family:'Courier New';\">instiftade vandringsprisen. T\u00e4vlingen gick i tvenne </span><br />\n<span style=\"font-family:'Courier New';\">klasser: allm\u00e4nna klassen och oldboysklassen. I</span><br />\n<span style=\"font-family:'Courier New';\">allm\u00e4nna klassen segrade Otto Holmberg med tiden</span><br />\n<span style=\"font-family:'Courier New';\">20,55 och erh\u00f6ll han I priset och tredje inteckningen</span><br />\n<span style=\"font-family:'Courier New';\">i Vaulos pokal samt d\u00e4rmed pokalen till egen f\u00f6r</span><br />\n<span style=\"font-family:'Courier New';\">alltid. II priset erh\u00f6ll V. V. Siik tid 23,17 och III</span><br />\n<span style=\"font-family:'Courier New';\">priset E. Hurskainen tid 25,30. F\u00f6ljande voro L.</span><br />\n<span style=\"font-family:'Courier New';\">Lehtonen och G. Piironen.</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp; Oldboysklassen vanns av V. Halme med tiden</span><br />\n<span style=\"font-family:'Courier New';\">24,10, som erh\u00f6ll I pris och det av A. Tiljander</span><br />\n<span style=\"font-family:'Courier New';\">sk\u00e4nkta bordsuret f\u00f6r ett \u00e5r fram\u00e5t. II pris erh\u00f6ll</span><br />\n<span style=\"font-family:'Courier New';\">fjol\u00e5rets f\u00f6rsta man B. Lindfors, tid 26,05 och III</span><br />\n<span style=\"font-family:'Courier New';\">pris K. Sir\u00e9n tid 26,54. F\u00f6ljande voro B. V\u00e4is\u00e4-</span><br />\n<span style=\"font-family:'Courier New';\">nen och V. Nystr\u00f6m. Prisen utgjordes av sm\u00e4rre</span><br />\n<span style=\"font-family:'Courier New';\">silverpj\u00e4ser, som erh\u00e5llits genom frivilliga bidrag</span><br />\n<span style=\"font-family:'Courier New';\">av brevb\u00e4rarna. Att intresset f\u00f6r skidning vid S\u00f6r-</span><br />\n<span style=\"font-family:'Courier New';\">n\u00e4s brevb\u00e4rarekontor \u00e4r stort, visar oss det livliga</span><br />\n<span style=\"font-family:'Courier New';\">deltagandet, men \u2014 l\u00e5t oss hoppas \u2014 att det till</span><br />\n<span style=\"font-family:'Courier New';\">n\u00e4sta \u00e5r \u00e4r \u00e4nnu st\u00f6rre. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span><em><span style=\"font-family:'Courier New';\">T \u2014 r.</span></em><em></em>\n</p>\n</div>\n</div>",
