"<div>\n<i class=\"NoteType\">\nLink\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<a href=\"http://digi.narc.fi/digi/view.ka?kuid=24833485\">http://digi.narc.fi/digi/view.ka?kuid=24833485</a><br />\n<a href=\"https://astia.narc.fi/uusiastia/viewer/?fileId=6038725854&amp;aineistoId=1167610777\">https://astia.narc.fi/uusiastia/viewer/?fileId=6038725854&amp;aineistoId=1167610777</a>\n</p>\n</div>\n<i class=\"NoteType\">\nTranscript\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<span style=\"font-family:'Courier New';\">206 S\u00f6derveckoski</span>\n</p>\n<p>\n<span style=\"font-family:'Courier New';\">Smed &nbsp;Isac Sundberg &nbsp; &nbsp; &nbsp; &nbsp;1756</span><br />\n<span style=\"font-family:'Courier New';\">hu &nbsp; &nbsp;Caisa Henricsdr &nbsp; &nbsp; &nbsp;1766</span><br />\n<span style=\"font-family:'Courier New';\">Lg &nbsp; &nbsp;Fredric Johansson &nbsp; &nbsp;1776</span>\n</p>\n</div>\n<i class=\"NoteType\">\nResearch\n</i>\n<div class=\"grampsstylednote\">\n<p>\nFredric Johansson asuu rippikirjan 1786-1794 mukaan <br />\nis\u00e4ns\u00e4 sepp\u00e4 Johan Mattssonin luona Hindh\u00e5r:ssa.<br />\nH\u00e4nen syntym\u00e4ajaksi on merkitty 1776.<br />\nEhtoollismerkint\u00f6j\u00e4 on v\u00e4lill\u00e4 10.4.1791-2.3.1793, <br />\nmink\u00e4 j\u00e4lkeen loppuvat. <br />\nMuulla perheell\u00e4 merkinn\u00e4t jatkuu 10.8.1794 asti.<br />\nSeuraavassa rippikirjassa Fredric ei ole merkittyn\u00e4 <br />\nmuun perheen yhteyteen.<br />\nT\u00e4st\u00e4 voi p\u00e4\u00e4tell\u00e4 ett\u00e4 Henric on joko kuollut tai <br />\nmuuttanut pois maaliskuun alun 1793 j\u00e4lkeen.\n</p>\n<p>\nSeurakunnasta pois muuttaneiden tietoja ei ole tuolta ajalta helposti saatavilla.\n</p>\n<p>\nKuolleista l\u00f6ytyy HisKin perusteella vuosilta 1793-1794 <br />\nnelj\u00e4 henkil\u00f6\u00e4 joilla etunimen\u00e4 Fredric (kaikki itse asiassa Carl Fredric) <br />\nn\u00e4ist\u00e4 nuorin 7vko ja vanhin 3v 9kk. (Oikea ik\u00e4 olisi n. 17-18)<br />\nKuolleista l\u00f6ytyy 62 kpl henkil\u00f6it\u00e4 joilla is\u00e4n nimen\u00e4 Johan, <br />\nn\u00e4ist\u00e4 kaikki joko v\u00e4\u00e4r\u00e4\u00e4 sukupuolta tai selke\u00e4sti v\u00e4\u00e4r\u00e4n ik\u00e4isi\u00e4.\n</p>\n<p>\nEdelleen rippikirjassa 1786-1794 on S\u00f6derveckkoskella <br />\nsepp\u00e4 Isaac Sandberg, jolla on oppipoika Fredric Johansson, <br />\njonka syntym\u00e4aika 1776. <br />\nT\u00e4lle on merkitty ehtoollisk\u00e4yntej\u00e4 alkaen 13.4.1794<br />\nT\u00e4m\u00e4 t\u00e4sm\u00e4isi siihen, ett\u00e4 sepp\u00e4 Johan Mattssonin poika <br />\nFredric on mennyt toisen sep\u00e4n oppipojaksi.\n</p>\n<p>\n1776 on seurakunnassa kirjattu syntyneeksi nelj\u00e4 Fredric Johanssonia:\n</p>\n<p>\n1776-03-11 Johan Erichsson/Cathrina Henricsdr Hindh\u00e5r Smeden https://www.sukuhistoria.fi/sshy/sivut/jasenille/paikat.php?bid=38709&amp;pnum=273<br />\n1776-06-07 Johan \u00c5berg/Anna Andersdr Haicko https://www.sukuhistoria.fi/sshy/sivut/jasenille/paikat.php?bid=38709&amp;pnum=276<br />\n1776-06-18 Johan Bergsten/Maria Johansdr Str\u00f6msberg https://www.sukuhistoria.fi/sshy/sivut/jasenille/paikat.php?bid=38709&amp;pnum=276<br />\n1776-06-21 Johan Ersson/Stina Matsdotter Stensb\u00f6le https://www.sukuhistoria.fi/sshy/sivut/jasenille/paikat.php?bid=38709&amp;pnum=277\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
