"<div>\n<i class=\"NoteType\">\nLink\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<a href=\"http://digi.narc.fi/digi/view.ka?kuid=7975259\">http://digi.narc.fi/digi/view.ka?kuid=7975259</a><br />\n<a href=\"https://astia.narc.fi/uusiastia/viewer/?fileId=5862666612&amp;aineistoId=1168976981\">https://astia.narc.fi/uusiastia/viewer/?fileId=5862666612&amp;aineistoId=1168976981</a>\n</p>\n</div>\n<i class=\"NoteType\">\nTranscript\n</i>\n<div class=\"grampsstylednote\">\n<p>\nD\u00f6de \u00e5r 1858<br />\nJanuarii M\u00e5nad<br />\n28    7/2    Anna Stina Sundman    Smed enka    79    \u00e5lderdom    Kullo Sisbacka\n</p>\n</div>\n<i class=\"NoteType\">\nResearch\n</i>\n<div class=\"grampsstylednote\">\n<p>\nKuolleiden luettelossa on sukunimen\u00e4 \"Sundman\" eik\u00e4 Sunnman. <br />\nMuut tiedot t\u00e4sm\u00e4\u00e4 kuitenkin - rippikirjaan merkitty kuolinp\u00e4iv\u00e4, <br />\nik\u00e4, etunimet, sep\u00e4n leski, asuinpaikka.\n</p>\n</div>\n</div>",
