"<div>\n<i class=\"NoteType\">\nCitation\n</i>\n<div class=\"grampsstylednote\">\n<p>\nPorvoon tuomiokunnan renovoidut tuomiokirjat - Ilmoitusasioiden p\u00f6yt\u00e4kirjat 1870-1870 (KO b:20), jakso 544; Kansallisarkisto: http://digi.narc.fi/digi/view.ka?kuid=47439649 / Viitattu 21.9.2020\n</p>\n</div>\n<i class=\"NoteType\">\nLink\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<a href=\"http://digi.narc.fi/digi/view.ka?kuid=47439649\">http://digi.narc.fi/digi/view.ka?kuid=47439649</a><br />\n<a href=\"https://astia.narc.fi/uusiastia/viewer/?fileId=4589629730&amp;aineistoId=655719493\">https://astia.narc.fi/uusiastia/viewer/?fileId=4589629730&amp;aineistoId=655719493</a>\n</p>\n</div>\n<i class=\"NoteType\">\nLink\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<a href=\"https://tuomiokirjat.narc.fi/detail/PjoMbc1J?term=nordberg&amp;search=eyJ0ZXJtIjoibm9yZGJlcmciLCJkaXN0cmljdCI6IlBvcnZvb24gdHVvbWlva3VubmFuIHJlbm92b2lkdXQgdHVvbWlva2lyamF0In0\">https://tuomiokirjat.narc.fi/detail/PjoMbc1J?term=nordberg&amp;search=eyJ0ZXJtIjoibm9yZGJlcmciLCJkaXN0cmljdCI6IlBvcnZvb24gdHVvbWlva3VubmFuIHJlbm92b2lkdXQgdHVvbWlva2lyamF0In0</a>\n</p>\n</div>\n<i class=\"NoteType\">\nTranscript\n</i>\n<div class=\"grampsstylednote\">\n<p>\n3dja Uppbudet \u00e5<br />\nhalfva Nybys<br />\nSkatte inth\u00e5ll<br />\ni Rullo by och<br />\nBorg\u00e5 socken.\n</p>\n<p>\ngodt godk\u00e4nna ifr\u00e5gavarande K\u00f6pslut s\u00e5mdn<br />\ndetsamma r\u00f6rde omyndige Johan Ediets och Rean<br />\nka Alexandras andelar i l\u00e4genheten.<br />\nSedan s\u00f6kanden f\u00f6rm\u00e4lt sig icke hafva n\u00e5gon<br />\nvidare utredning i \u00e4rendet att tillg\u00e5, tillsades<br />\nhonom att jemte \u00f6frige vederb\u00f6rande aftr\u00e4de<br />\ninnan \u00f6fverl\u00e4ggningen till f\u00f6ljande<br />\nUtslag:<br />\nSom s\u00f6kanden Johan Willchad Andersson<br />\nJaakela icke kunnat Styrka sine f\u00f6retr\u00e4da\u2010<br />\nres \u00e5tkomst till ifr\u00e5gavarande hemmansdelar.<br />\nallts\u00e5 kan den s\u00f6kta lagfarten honom icke<br />\nmeddelas; men finner H\u00e4radsr\u00e4tten dock jodt<br />\natt, i St\u00f6d af Kejserliga F\u00f6rodningen den 141.<br />\nMars 1864. om huru vid ans\u00f6kning om lagfart<br />\nf\u00f6rfaras Skall d\u00e5 s\u00f6kanden icke kan tillf\u00f6r=<br />\nlitligen utreda sin f\u00f6retr\u00e4dares \u00e5tkomst till l\u00e4\u2010<br />\ngenheten, till\u00e5ta s\u00f6kanden att genom trenne<br />\ng\u00e5nger i landets officiella s\u00e5v\u00e4l p\u00e5 svenska<br />\nsom finska sjur\u00e5ket utkommande tidningar in\u2010<br />\nf\u00f6rande annons uppmana den eller dem, som<br />\nto sig ega fog till klander af ifr\u00e5gavarande<br />\njordef\u00e5ns, att sin Klandertalan inom nad<br />\noch \u00e5r efler det annonsen varit tredje glngen<br />\ni tidningarne inf\u00f6rd, vid denna H\u00e4radsr\u00e4tt an\u2010<br />\nm\u00e5la och utf\u00f6ra vid \u00e4fventyr att den s\u00f6k\u2010<br />\nta lagfarten eljest meddelas. Hvilket \u00e5 in\u2010<br />\nkallandet afsades.<br />\nSS: 30.<br />\nI egenskap os lagligen befullmiiktigadt<br />\nombud f\u00f6r Rusth\u00e5llaren Karl Gustaf Matts\u2010<br />\nson Nybys, fr\u00e5n Fullo by i Borg\u00e5 socken, an\u2010<br />\nh\u00f6ll Skallfogden August Sullberg att Karl=<br />\nGustaf Matsson Nybys m\u00e5tte meddelas tre=<br />\ndje uppbudet \u00e5 halfva nisbys k\u00e4tternssh\u00e4ll\n</p>\n<p>\ni ber\u00f6rde by, hvilken l\u00e4genhet s\u00f6kanden dels<br />\nvrst efter sin fader Rusth\u00e5llaren Matts Matts\u2010<br />\nson och dels efter \u00e5 densamma aisalt v\u00e4rde af<br />\nfyratusen \u00e5ttahundra mark, den 31. Oktober 1865.<br />\ntillhandlat sig af sin moder Bondeenkan Helena<br />\nAndersdotter, s\u00e5som dess of\u00f6rs\u00f6rjda dotter Sofia<br />\nLovisa Mattssdotters r\u00e4ttsbevakare samt f\u00f6ljande<br />\n\u00f6frige samalfna nemligen: br\u00f6derne Matts och<br />\nAnders Johan Mattss\u00f6ner samt syster Anna Str=<br />\nStina Mattsdotter jemte hennes man Bonden<br />\nJohan Wordberg Antas, emot till hvardera af<br />\nbr\u00f6derna erlagd utl\u00f6sen os ettusen tv\u00e5hundra<br />\nmark \u00f6d, till hvardera af systrarne af sex=<br />\nhundra mark eller tillsammans tretusen sex=<br />\nhundra mark, f\u00f6rutom fullg\u00f6rande af andra<br />\nvilkor \u00f6d sytningsbeting; inlemnande ombudet kuu=<br />\nberg i omf\u00f6rm\u00e4ldt afseende utdrag ur denne H\u00e4rads=<br />\nr\u00e4tts vid n\u00e4rtvikene 1869. \u00e5rs lagtima h\u00f6stling den<br />\n1. September under SS: 17. och innevarande 1870. \u00e5rs<br />\nlrgtima vinterling den 1. Februari under SS: 18. i lag=<br />\nfart\u00e4render f\u00f6rde protokoll, af hvilka vid ge=<br />\nnoml\u00e4sandet inhemtades att Karl Gustaf Matts=<br />\nson Nybys n\u00e4mnde dagar meddelats det f\u00f6r\u2010<br />\nsta och andra klanderfria uppbudet \u00e5 ifr\u00e5ga\u2010<br />\nvarande rusth\u00e5llsh\u00e4lft, men \u00e5lligt att, innan<br />\ntredje uppbudet icke allenast styrka l\u00e4gen\u2010<br />\nhetens nummer, jordnatur och mantalsstorlek,<br />\nutan ock tillf\u00f6rtitligen iteda det krigsmans=<br />\nhns och Karta sigilleta rekognitions afgifterne<br />\nf\u00f6r s\u00f6kandens tilltr\u00e4de till rusth\u00e5llsh\u00e4lften<br />\nblifvit erlagde, \u00e4fvensom, derest rusth\u00e5lls h\u00e4lften<br />\nvore intecknad till s\u00e4kerhet f\u00f6r penningelan ur<br />\nFinlands bank, Finska milit\u00e4rens, giil= eller ek=<br />\nKlesias tik staternes enke - och pupill Kassor, f\u00f6=<br />\nrete bevis derom att l\u00e5net antingen blifvit in\u2010\n</p>\n<p>\n36.<br />\n541.\n</p>\n</div>\n</div>",
