"<div>\n<i class=\"NoteType\">\nCitation\n</i>\n<div class=\"grampsstylednote\">\n<p>\nUudenmaan l\u00e4\u00e4nin henkikirjat - U:82 Henkikirja 1878-1878, jakso 523, sivu 1957: Wallg\u00e5rd; Kansallisarkisto: https://astia.narc.fi/uusiastia/viewer/?fileId=5249223383&amp;aineistoId=2106964281 / Viitattu 24.7.2022\n</p>\n</div>\n<i class=\"NoteType\">\nLink\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<a href=\"https://astia.narc.fi/uusiastia/viewer/?fileId=5249223383&amp;aineistoId=2106964281\">https://astia.narc.fi/uusiastia/viewer/?fileId=5249223383&amp;aineistoId=2106964281</a>\n</p>\n</div>\n<i class=\"NoteType\">\nTranscript\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1957</span>\n</p>\n<p>\n<span style=\"font-family:'Courier New';\">[Wallg\u00e5rd] &nbsp; &nbsp; &nbsp;1 &nbsp;[Hg] &nbsp;[arbetaren] Ferdinand Nordberg med hustru &nbsp; &nbsp;1 &nbsp;1 &nbsp; &nbsp;2 &nbsp;1 &nbsp; &nbsp;3 &nbsp;2 &nbsp;5 &nbsp;B.2-1</span>\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n<i class=\"NoteType\">\nResearch\n</i>\n<div class=\"grampsstylednote\">\n<p>\nLasten kohdalle on merkitty \"2-1\" l. 2 poikaa ja  1 tytt\u00f6, mik\u00e4 ei t\u00e4sm\u00e4\u00e4: <br />\nJos tiedot on kes\u00e4kuulta 1878 niin silloin perheess\u00e4 on ollut elossa lapset<br />\nEmil Ferdinand, Maria Charlotta Wilhelmina, ja Elin Maria, eli merkint\u00e4 pit\u00e4isi olla toisin p\u00e4in \"1-2\"<br />\n(Viktor Leonard kuoli jo 1877 ja Viktor Ferdinand syntyi vasta 1882)\n</p>\n<p>\nVoi olla kirjausvirhe, mutta pit\u00e4\u00e4 huomioida ja tarkistaa ett\u00e4 kyseess\u00e4 ei ole v\u00e4\u00e4r\u00e4 perhe,<br />\n tai ett\u00e4 joku lapsi puuttuu tai tiedot on v\u00e4\u00e4rin.\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nCitation\n</i>\n<div class=\"grampsstylednote\">\n<p>\nUudenmaan l\u00e4\u00e4nin henkikirjat - U:84a Henkikirja 1879-1879, jakso 456: Wallg\u00e5rd; Kansallisarkisto: https://astia.narc.fi/uusiastia/viewer/?fileId=5298915907&amp;aineistoId=2107000987 / Viitattu 24.7.2022\n</p>\n</div>\n<i class=\"NoteType\">\nLink\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<a href=\"https://astia.narc.fi/uusiastia/viewer/?fileId=5298915907&amp;aineistoId=2107000987\">https://astia.narc.fi/uusiastia/viewer/?fileId=5298915907&amp;aineistoId=2107000987</a>\n</p>\n</div>\n<i class=\"NoteType\">\nTranscript\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1861</span><br />\n<span style=\"font-family:'Courier New';\">[Wallg\u00e5rd] &nbsp; &nbsp; &nbsp;1 &nbsp;[Hg] &nbsp;Br\u00e4dg\u00e5rdsarbetaren Ferdinand Nordberg</span><br />\n<span style=\"font-family:'Courier New';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;h. Sofia &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1 &nbsp;1 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1 &nbsp;1 &nbsp;2</span>\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n<i class=\"NoteType\">\nResearch\n</i>\n<div class=\"grampsstylednote\">\n<p>\nLapsia ei ole n\u00e4hd\u00e4kseni merkitty lainkaan, mik\u00e4 ei t\u00e4sm\u00e4\u00e4 siihen montako niit\u00e4 pit\u00e4isi olla.<br />\nTosin koko muulla sivulla ei lapsia n\u00e4y merkityn kuin kahdelle muulle riville mik\u00e4 her\u00e4tt\u00e4\u00e4 ep\u00e4ilyksen ett\u00e4 kirjaukset ovat puutteelliset.\n</p>\n<p>\nAmmatiksi on merkitty Br\u00e4dg\u00e5rdsarbetare. Vaikuttaa silt\u00e4 ett\u00e4 Dykeriarbetare joka on mm rippikirjaan merkitty, <br />\ntodenn\u00e4k\u00f6isesti koskee vasta my\u00f6hemp\u00e4\u00e4 aikaa.\n</p>\n</div>\n</div>",
